import React from 'react';
import { Route, Redirect } from 'react-router-dom';

export function ProtectedRoute({ loggedIn, ...restProps}) {
  if(!loggedIn){
    return <Redirect to="/sign-in" />
  }
  return <Route {...restProps}></Route> 

};
